import React, { useState } from 'react'

const Config = (props) => {
    const [isMiddle, setIsMiddle] = useState(false)
    const [isLightMiddle, setIsLightMiddle] = useState(false)
    const [isAma, setIsAma] = useState(false)
    
    const handleMiddle = () => {
        props.setModalOpen(true)
    }
    const handleLightMiddle = () => {
        props.setModalOpen(true)
    }
    const handleAma = () => {
        props.setModalOpen(true)
    }

    return (
        <div className='modal-wrapper'>
            <div className='modalContents'>
                <h2>SPEC SELECT</h2>
                <div className='specSelect'>
                    <button className='selectMiddle'>middle</button>
                    <p className='aboutMiddle'>spec</p>
                    <button className='selectLightMiddle'>lightMiddle</button>
                    <p className='aboutLightMiddle'>spec</p>
                    <button className='selectAma'>ama</button>
                    <p className='aboutAma'>spec</p>
                    <button className='startMiddle' onClick={handleMiddle}>start</button>
                    <button className='startLightMiddle' onClick={handleLightMiddle}>start</button>
                    <button className='startAma' onClick={handleAma}>start</button>
                </div>
            </div>
        </div>
    )
}

export default Config
